    // Tool Function
    function get_ratio(data) {
        /* behind/all */
        return data[1]/data[2];
    }

    function toInt(l) {
        let result = []
        l.forEach(element => {
            result.push(parseInt(element));
        });
        return result;
    }

    function isIn(list,value,omit=[]) {
        for (let i=0;i<list.length;i++) {
            if (_.isEqual(_.omit(list[i], omit),_.omit(value, omit))) {
                return true;
            }
        }
        return false;
        
    }

